"""
UPER:
U:
    > Given a string
    > The string is valid if all the characters appear the same number of times
    > It is also valid if he can remove just 1 character at 1 index to make it valid.
    > return if the string is valid or not

P:
    > iterate through string, adding to cache each letter and increases its value each time

"""
s = ''
# s = 'aabbccdddeeff'
def isValid(s):
    cache = {}
    cache2 = {}

    # Count repeated numbers into the cache
    for n in s:
        if n in cache:
            cache[n] += 1
        else:
            cache[n] = 1

    # Count groups of repeated numbers into new cache
    for key in cache:
        if cache[key] in cache2:
            cache2[cache[key]] += 1
        else:
            cache2[cache[key]] = 1
    
    # If there are more than two groups of repeated numbers it is not valid
    if len(cache2) > 2:
        return("NO")
    
    # If there is only one group of repeated numbers it is valid!
    if len(cache2) == 1:
        return("YES")
    
    # the oddball out
    loner = 0
    # the common repeated count
    master = 0

    # Set the two variables based off of how many are in each group
    for key in cache2:
        if cache2[key] == len(cache)-1:
            master = key
        else:
            loner = key


    if cache2[loner] == 1:
        if loner == master+1:
            return("YES")
        elif loner == 1:
            return("YES")
        else:
            return("NO")
    else:
        return("NO")



isValid(s)